import React,{useContext} from 'react'
import {MyContext} from "../WorkPage"


function WorkDetails() {
   
     const context = useContext(MyContext)

    return (
        <div>
           <MyContext.Consumer>
           {value=>{
               <button onClick={() => {
                console.log(context)
            }}> click me buddy</button>
           }}
           </MyContext.Consumer>
           

        </div>
    )
}

export default WorkDetails
